import React from "react";
import home from '../../../images/home.jpg'
import chat from '../../../images/chat.jpg'
import notification from '../../../images/Notification.jpg'
import './Menu.css'
import Explore from '../../../images/Explore.jpg'
import ProfileIcon from "./ProfileIcon/ProfileIcon";
import image from '../../../images/berserk.jpg'

const Menu=()=>{

    return(
        <div className="menu">
            <img className="home" src={home} alt=""/>
            <img className="message" src={chat} alt=""/>
            <img className="notification" src={notification} alt=""/>
            <img className="explore" src={Explore} alt=""/>
            <ProfileIcon iconSize='small' image={image} storyBorder={true} />
        </div>
    )
}

export default Menu
